import React from "react";
import { Route, Link } from "react-router-dom";
import godzillaList from "../../lists/godzillaList";
import GodzillaPath from "./godzillaPathname";

const GodzillaRouter = () => {
  for (let i = 0; i < godzillaList.length; i++) {
    return (
      <Route
        path={"/godzilla-list" + godzillaList[i].link}
        component={GodzillaPath}
      />
    );
  }
};

export default GodzillaRouter;
